using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// The UITraitEnvironment protocol provides access to the UITraitCollection object for a view controller. The traitCollectionDidChange: method is automatically called when a trait for a view controller changes. Implement this method to respond to changes in the trait collection.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UITraitEnvironment_Ref/index.html#//apple_ref/occ/intf/UITraitEnvironment"/>    [iOSVersion(8)]    [Export("")]    public interface UITraitEnvironment//: NSObjectProtocol    {        /// <summary>        /// Provides a way for you to perform custom behavior when the current trait collection changes. (required)        /// </summary>        /// <param name="previousTraitCollection">The UITraitCollection object before any traits were changed.</param>        [iOSVersion(8)]        [Export("traitCollectionDidChange")]        void TraitCollectionDidChange([Optional] UITraitCollection previousTraitCollection);                /// <summary>        /// The collection of traits for the view. (required) (read-only)        /// </summary>        [iOSVersion(8)]        [Export("traitCollection")]        UITraitCollection TraitCollection { get; }    }}